function troca_foto(campo,tipo,foto){
    if(foto == 'data:image/png;base64,'){
        $(campo).css('background-size', '60%');
    }else{
        $(campo).css('background-size', '100%');
    }
    if(tipo == 1){
        $(campo).css('background-image', 'url("'+foto+'")');
    }else{
        $(campo).attr("src", foto);
    }
}

